import React from 'react';
import './App.css';

class App extends React.Component {


    constructor(props){
      super(props);
      this.state ={
        title: "Arshdeep Singh",
        headerlinks: [
        {title:'Arshdeep', path:'deep'},
        {title:'Case Studies'},
        {title:'Contact'}
        ],
        home:{
          title:'Arshdeep'
        }
      }
    }


    render(){
      return (
        <div>AAP</div>
      );
    }

  }

export default App;
